void getLPC(int start, int end)
{
	for (row = 0; row < p; row++)
	{
		r[row][0] = 0;
		for (col = 0; col < p; col++)
		{
			R[row][col] = 0;
		}
	}

	//Calculating LPC for word sample
	for (n = start + p; n <= end; n++)
	{
		//Calculating r
		for (_p = 1; _p <= p; _p++)
		{
			r[_p - 1][0] += (float)s_arr_isolate[n] * (float)s_arr_isolate[n - _p];
			s[_p - 1][0] = (float)s_arr_isolate[n - _p];
		}

		//Calculating R
		//Gettting tranpose of s_(n-1)
		s_t = TransposeMatrix(s, p, 1);
		//R matrix for this signal
		temp_R = MultiplyMatrix(s, p, 1, s_t, 1, p);

		//Helper function to add tempR to R
		//Adding tempR to the total R
		for (row = 0; row < p; row++)
		{
			for (col = 0; col < p; col++)
			{
				R[row][col] += temp_R[row][col];
			}
		}
	}


	temp_R = InverseMatrix(R, p);
	temp_a = MultiplyMatrix(temp_R, p, p, r, p, 1);

	//Storing all a's
	for (row = 0; row < p; row++)
	{
		a[row][word_count] = temp_a[row][0];
	}
}

void getMean(void)
{
	//Getting mean
	for (col = 0; col < word_count; col++)
	{
		for (row = 0; row < p; row++)
		{
			a[row][word_count] += a[row][col];
		}
	}
	printf("Average:\n");
	for (row = 0; row < p; row++)
	{
		a[row][word_count] /= word_count;
	}
	for (row = 0; row < p; row++)
	{
		printf("%f,", a[row][word_count]);
	}
	printf("\n");
}

